import React, {Fragment} from 'react';
import {StyleSheet} from 'react-native';
import {Icon, Timeline} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';

//#4F84C4"

const useStyle: any = {
  arrowLeft: {
    width: '0',
    height: '0',

    borderTop: '20px inset transparent',
    borderBottom: '20px inset transparent',
    borderRight: '20px inset #4F84C4 ',

    marginLeft: '40px',
    position: 'absolute',
    filter: 'drop-shadow(0px 0px 1px rgba(0,0,0,2))',
  },
};
export type TimeLineVProps = {
  timelinedata?: any;
  customTimelineStyles?: any;
  contentStyles?: any;
  iconsStyles?: any;
  titleStyle?: any;
  subTitleStyle?: any;
};
const TimeLineV = (props: TimeLineVProps) => {
  const {
    timelinedata,
    customTimelineStyles,
    contentStyles,
    iconsStyles,
    titleStyle,
    subTitleStyle,
  } = props;
  const output: any = [];
  const getTimeline = () => {
    Array.isArray(timelinedata) &&
      timelinedata.forEach(items => {
        output.push(
          <Fragment>
            <Timeline.Item
              dot={
                <Icon
                  style={StyleSheet.flatten([iconsStyles])}
                  icon={items.icon}
                  size="2x"
                />
              }
            >
              <div style={StyleSheet.flatten([useStyle.arrowLeft])}></div>
              <div style={StyleSheet.flatten([contentStyles])}>
                <p style={StyleSheet.flatten([titleStyle])}>{items.date}</p>
                <p style={StyleSheet.flatten([subTitleStyle])}>
                  {items.status}
                </p>
              </div>
            </Timeline.Item>
          </Fragment>,
        );
      });
    return output;
  };
  return (
    <Timeline style={StyleSheet.flatten([customTimelineStyles])}>
      {getTimeline()}
    </Timeline>
  );
};
export default TimeLineV;
